            const classId = urlParams.get('classId');
            const subject = urlParams.get('subject');

            if (classId) {
                $('select[name=""classId""]').val(classId);
            }

            if (subject) {
                $('select[name=""subject""]').val(subject);
            }

            // 添加按钮动画
            $('.btn-success').hover(
                function () {
                    $(this).find('i').addClass('fa-beat');
                },
                function () {
                    $(this).find('i').removeClass('fa-beat');
                }
            );
        });
    </script>
");
